import React,{useState, useEffect} from "react";
import { useDispatch, useSelector } from "react-redux";

const Profile = () => {
  const { isLoggedIn } = useSelector(state => state.auth);
  const { userData: currentUserData } = useSelector((state) => state.auth);
  const [user, setUser] = useState("");
  console.log(currentUserData)
  const dispatch = useDispatch();
  return (
    <div>
      <header>
        <h3>
          Hi, <strong>{currentUserData && currentUserData.name}</strong>
        </h3>
      </header>
      <p>
        <strong>Id:</strong> {currentUserData && currentUserData.id}
      </p>
      <p>
        <strong>Email:</strong> {currentUserData && currentUserData.email}
      </p>
      
    </div>
  );
};

export default Profile;
